import React, { Component } from "react";
import Chart from "react-apexcharts";

const Column = ({ props }) => {
  {
    return (
      <Chart
        options={this.props.options}
        series={this.props.series}
        type="bar"
        width="500"
      />
    );
  }
};

export default Column;
